#define keys (volatile int*) KEYS_BASE
#define ps22 (volatile int*)  PS2_0_BASE
#define drawer_base (volatile int *) PIXEL_DRAWER_0_BASE

int pokemon;// a value between 0 to 9 (0 means have not selected)
int enemy;//a value between 1 to 3
int map;// home:map=0, wild:map=1, final battle map=2
int keyinput;//De2 button 
int	ps2_data;//keyboard
int position_global;//position of player
int random;//a random number 
int mode;//starting=0, fight=1, evolve=2
int hp;
int enemy_hp;
int run;//equals to 1 if player ran away
int scroll;//movement of the cloud

alt_up_pixel_buffer_dma_dev* pixel_buffer;
alt_up_char_buffer_dev *char_buffer;

int main()
{
	init();
	int battle;//not fighting=0, fight=1
	int result = 2;//win=1, lost=2

	while(1)
	{
		keyinput = *keys;
		ps2_data = *(ps22);
		
		if(map==1)
		{
			//move the cloud
			if(scroll<320)
			{
				move_cloud(scroll, pixel_buffer);
				scroll++;
			}
			else{
				scroll = 0;//reset the cloud conter
			}
		}
		//return 0 if not fight, return 1 if got into a fight
		battle = check_move(position_global, keyinput, ps2_data, map, char_buffer, pixel_buffer);

		if(pokemon == 0)//check if player has selected a pokemon
		{
			pokemon = select_pokemon(position_global, char_buffer, pixel_buffer);
		}
		if(battle == 1)//check if playe wins
		{
			result = fight(pokemon, enemy, char_buffer, pixel_buffer);
			battle = 0;
		}
		if(result == 1)
		{
			draw_wild(char_buffer, pixel_buffer);
			ash_forward(position_global, pixel_buffer);
			result = 2;
			//evolve the pokemon after winning a fight
			evolve(pokemon, char_buffer, pixel_buffer);
			if(pokemon<7) //a pokemon labelled 7 or above can't evolve anymore
			{
				enemy = 2; //set new enemy
				draw_background(pixel_buffer);
				ash_forward(position_global, pixel_buffer);
			}
			else
			{
				//final battle
				enemy = 3;
				map = 3;
				// Clear the screen
				alt_up_pixel_buffer_dma_clear_screen(pixel_buffer, 0);
				draw_background(pixel_buffer);
				position_global = 100;
				ash_forward(position_global, pixel_buffer);
				draw_mewtwo(pixel_buffer, 1);
				alt_up_char_buffer_string(char_buffer, "The ultimate enemy appears!!!", 0, 0);
				alt_up_char_buffer_string(char_buffer, "Mewtwo: I'm going to destroy the world", 0, 2);
				alt_up_char_buffer_string(char_buffer, "try to stop me if you dare!!!", 0, 3);
				usleep(5000000);

				result = fight(pokemon, enemy, char_buffer, pixel_buffer);
				if(result == 1)
				{
					//clear text
					alt_up_char_buffer_clear(char_buffer);
					// Clear the screen
					alt_up_pixel_buffer_dma_clear_screen(pixel_buffer, 0);
					
					alt_up_char_buffer_string(char_buffer, "Congratulation you win this game!!!", 15, 30);
					while(1);
				}
			}

			draw_background(pixel_buffer);
			ash_forward(position_global, pixel_buffer);
		}
		else if(result == 0)
		{
			draw_wild(char_buffer, pixel_buffer);
			ash_forward(position_global, pixel_buffer);
			result = 2;
		}
	}
	return 0;

}

void init()
{

		//set vga
		pixel_buffer = alt_up_pixel_buffer_dma_open_dev("/dev/pixel_buffer_dma");
		alt_up_pixel_buffer_dma_change_back_buffer_address(pixel_buffer, PIXEL_BUFFER_BASE);
		alt_up_pixel_buffer_dma_swap_buffers(pixel_buffer);
		while (alt_up_pixel_buffer_dma_check_swap_buffers_status(pixel_buffer));
		alt_up_pixel_buffer_dma_clear_screen(pixel_buffer, 0);
		if (pixel_buffer == 0) {
			printf("error initializing pixel buffer (check name in alt_up_pixel_buffer_dma_open_dev)\n");
		}
		char_buffer = alt_up_char_buffer_open_dev("/dev/character_buffer");
		alt_up_char_buffer_init(char_buffer);
		//set keyboard
		alt_up_ps2_dev	*	ps2	=	alt_up_ps2_open_dev("/dev/ps2_0");
		alt_up_ps2_init(ps2);
		//set audio
		av_config_setup();
		readSD();
		initialize_audio_irq();

		// Clear the screen
		alt_up_pixel_buffer_dma_clear_screen(pixel_buffer, 0);
		
		//clear text
		alt_up_char_buffer_clear(char_buffer);

		position_global = 10;

		//set map = home
		map = 0;
		//set pokemon to selecting mode
		mode = 0;

		//counter for cloud
		scroll = 0;

		//set initial enemy
		enemy = 1;
		//draw textbox
		alt_up_pixel_buffer_dma_draw_box(pixel_buffer, 0, 0, 320, 40, 0x00000000,0);
		//draw background of home
		draw_home(char_buffer, pixel_buffer);
		//draw player
		ash_forward(position_global, pixel_buffer);

}
//check if player reaches the boundary of the map, switch map if applicable
void check_boundary()
{
	if(map == 0)
	{
		if(position_global > 300)
		{
			map = 1;
			position_global = 10;
			draw_wild(char_buffer, pixel_buffer);
		}
		else if(position_global < 0)
		{
			position_global = 0;
		}
	}
	else if(map == 1)
	{
		if(position_global < 1)
		{
			map = 0;
			draw_home(char_buffer, pixel_buffer);
			position_global = 280;
		}
		else if(position_global > 286)
		{
			position_global = 286;
		}
	}
}
//backgournd of palyer'shome
void draw_home(alt_up_char_buffer_dev *char_buffer, alt_up_pixel_buffer_dma_dev* pixel_buffer)
{

	alt_up_pixel_buffer_dma_draw_box(pixel_buffer, 0, 40, 320, 240, 0xd6fad6fa,0);
	draw_starter(pixel_buffer);
	//play blackground music
	playBGM();
}
//wild where player can fight
void draw_wild(alt_up_char_buffer_dev *char_buffer, alt_up_pixel_buffer_dma_dev* pixel_buffer)
{
	//clear text
	alt_up_char_buffer_clear(char_buffer);

	move_cloud(scroll, pixel_buffer);
	draw_background(pixel_buffer);
	playBGM();
}
//check for keyboard/de2 switch input
//de2 key0 = 6, key1=10, key3=12
//keyboard left arrow=107, right arrow = 116, top arrow=117
int check_move(int position, int keyinput, int ps2_data, int map, alt_up_char_buffer_dev *char_buffer, alt_up_pixel_buffer_dma_dev* pixel_buffer)
{

			if(keyinput == 10 || ps2_data == 116)
			{
				if(map==1)
				{
					alt_up_pixel_buffer_dma_draw_box(pixel_buffer, position, 185, position+34, 230, 0x7d6e,0);
					position_global = position+34;
				}
				else if(map==0)
				{
					alt_up_pixel_buffer_dma_draw_box(pixel_buffer, position, 185, position+34, 230, 0xd6fad6fa,0);
					position_global = position+10;
				}

				check_boundary();
				ash_forward(position_global, pixel_buffer);

				if(map == 1)
				{
					//randomly determines if player gets into a fight, set to 20% chance on every move
					random = (rand()% 10 +1);
					if (random < 2)
					{
						//show annimation when gets into a fight
						draw_exclamation(position, pixel_buffer);
						usleep(1000000);

						return 1;
					}
				}

			}
			else if(keyinput == 6 || ps2_data == 107)
			{
				if(map==1)
				{
					alt_up_pixel_buffer_dma_draw_box(pixel_buffer, position, 185, position+34, 230, 0x7d6e,0);
					position_global = position-34;
				}
				else if(map==0)
				{
					alt_up_pixel_buffer_dma_draw_box(pixel_buffer, position, 185, position+34, 230, 0xd6fad6fa,0);
					position_global = position-10;
				}
				check_boundary();
				ash_backward(position_global, pixel_buffer);

				if(map == 1)
				{
					random = (rand()% 10 +1);
					if (random < 2)
					{
						return 1;
					}
				}

			}
		return 0;

}
//select starting pokemon, when player is under one of the pokeball press up arrow or key 3
//the system will comfirm the selection, 
//press z on keyboard or de2 key0 for yes, press x on keyboard or de2 key1 for no
//if player chooses no the function will return 0
int select_pokemon(int position,alt_up_char_buffer_dev *char_buffer, alt_up_pixel_buffer_dma_dev* pixel_buffer)
{
	int keyinput= *keys;
	ps2_data = *(ps22);
	if(position<80 && (keyinput == 12|| ps2_data == 117))
	{
		//clear text
		alt_up_char_buffer_clear(char_buffer);
		//show text
		alt_up_char_buffer_string(char_buffer, "Choose Charmander?", 0, 0);
		alt_up_char_buffer_string(char_buffer, "Yes", 0, 3);
		alt_up_char_buffer_string(char_buffer, "no", 10, 3);
		draw_charmander(pixel_buffer, 0);
		//keep reading until a valid input is taken
		while(keyinput != 10 && keyinput != 6 && ps2_data != 26 && ps2_data !=34)
		{
			keyinput= *keys;
			ps2_data = *(ps22);
		}
		//if player chooses yes
		if(keyinput == 6 || ps2_data == 26)
		{
			alt_up_char_buffer_string(char_buffer, "Charmander I choose you!", 0, 4);
			return 1;

		}
		//if player chooses no
		else if(keyinput == 10 || ps2_data == 34)
		{
			return 0;
		}
	}
	else if(position<160 && position>=90 && (keyinput== 12|| ps2_data == 117))
	{
		//clear text
		alt_up_char_buffer_clear(char_buffer);
		//show text
		alt_up_char_buffer_string(char_buffer, "Choose Squirtle?", 0, 0);
		alt_up_char_buffer_string(char_buffer, "Yes", 0, 3);
		alt_up_char_buffer_string(char_buffer, "no", 10, 3);
		draw_squirtle(pixel_buffer, 0);
		//keep reading until a valid input is taken

			while(keyinput != 10 && keyinput != 6 && ps2_data != 26 && ps2_data !=34)
			{
				keyinput = *keys;
				ps2_data = *(ps22);
			}
			if(keyinput == 6 || ps2_data == 26)
			{
				alt_up_char_buffer_string(char_buffer, "Squirtle I choose you!", 0, 4);
				return 2;
			}
			else if(keyinput == 10 || ps2_data == 34)
			{

				return 0;
			}


	}
	else if(position>=180 && (keyinput== 12|| ps2_data == 117))
	{
		//clear text
		alt_up_char_buffer_clear(char_buffer);
		//clear text
		alt_up_char_buffer_string(char_buffer, "Choose Bulbasaur?", 0, 0);
		alt_up_char_buffer_string(char_buffer, "Yes", 0, 3);
		alt_up_char_buffer_string(char_buffer, "no", 10, 3);
		draw_bulbasaur(pixel_buffer, 0);
		//read input again
		while(keyinput != 10 && keyinput != 6 && ps2_data != 26 && ps2_data !=34)
		{
			keyinput = *keys;
			ps2_data = *(ps22);
		}
		if(keyinput == 6 || ps2_data == 26)
		{
			alt_up_char_buffer_string(char_buffer, "Bulbasaur I choose you!", 0, 4);
			return 3;
		}
		else if(keyinput == 10 || ps2_data == 34)
		{

			return 0;
		}
	}

	return 0;

}
//set up the fight, draw enemy and health bar
//return 1 when player wins, 0 when player loses
int fight(int pokemon, int enemy, alt_up_char_buffer_dev *char_buffer, alt_up_pixel_buffer_dma_dev* pixel_buffer)
{

	alt_up_pixel_buffer_dma_draw_box(pixel_buffer, 0, 40, 320, 240, 0xffffffff,0);
	alt_up_char_buffer_clear(char_buffer);
	if(enemy == 1)
	{
		alt_up_char_buffer_string(char_buffer, "A wild Caterpie appears!", 0, 0);
		enemy_hp = 10;
		draw_caterpie(pixel_buffer);

	}else if(enemy == 2)
	{
		alt_up_char_buffer_string(char_buffer, "A wild Growlithe appears!", 0, 0);
		enemy_hp = 20;
		draw_growlithe(pixel_buffer);
	}else if(enemy == 3)
	{
		alt_up_char_buffer_string(char_buffer, "This is your final battle!", 0, 0);
		enemy_hp = 30;
		draw_mewtwo(pixel_buffer, 2);
	}
	usleep(1000000);


	enemy_health_bar(enemy_hp, char_buffer, pixel_buffer);
	//clear text
	alt_up_char_buffer_clear(char_buffer);
	run = 0;

	if(pokemon == 1)
	{
		hp = 20;
		draw_charmander(pixel_buffer, 1);
		health_bar(hp, char_buffer, pixel_buffer);
	}
	else if(pokemon == 2)
	{
		hp = 20;
		draw_squirtle(pixel_buffer, 1);
		health_bar(hp, char_buffer, pixel_buffer);
	}
	else if(pokemon == 3)
	{

		hp = 20;
		draw_bulbasaur(pixel_buffer , 1);
		health_bar(hp, char_buffer, pixel_buffer);
	}
	else if(pokemon == 4)
	{

		hp = 35;
		draw_charmeleon(pixel_buffer , 1);
		health_bar(hp, char_buffer, pixel_buffer);
	}
	else if(pokemon == 5)
	{

		hp = 35;
		draw_wartortle(pixel_buffer , 1);
		health_bar(hp, char_buffer, pixel_buffer);
	}
	else if(pokemon == 6)
	{

		hp = 35;
		draw_ivysaur(pixel_buffer , 1);
		health_bar(hp, char_buffer, pixel_buffer);
	}
	else if(pokemon == 7)
	{

		hp = 50;
		draw_charizard(pixel_buffer , 1);
		health_bar(hp, char_buffer, pixel_buffer);
	}
	else if(pokemon == 8)
	{

		hp = 50;
		draw_blastoise(pixel_buffer , 1);
		health_bar(hp, char_buffer, pixel_buffer);
	}
	else if(pokemon == 9)
	{

		hp = 50;
		draw_venusaur(pixel_buffer , 1);
		health_bar(hp, char_buffer, pixel_buffer);
	}

	while(hp > 0 && enemy_hp > 0 && run != 1)
	{

		player_moves(hp, enemy_hp);
		if(enemy_hp<1)
		{
			return 1;
		}

		//clear text
		alt_up_char_buffer_clear(char_buffer);
		enemy_moves(hp, enemy_hp, enemy);
		if(hp<1)
		{
			return 0;
		}

		//clear text
		alt_up_char_buffer_clear(char_buffer);

	}
	return 0;
}

//draw player's health bar
void health_bar(int hp, alt_up_char_buffer_dev *char_buffer, alt_up_pixel_buffer_dma_dev* pixel_buffer)
{
		//player
		alt_up_char_buffer_string(char_buffer, "HP:", 25, 45);
		alt_up_pixel_buffer_dma_draw_box(pixel_buffer, 95, 178, 175, 187, 0x00000000,0);

		alt_up_pixel_buffer_dma_draw_box(pixel_buffer, 115, 181, 115+hp, 183, 0xe025e025,0);
}
//draw enemy's health bar
void enemy_health_bar(int enemy_hp, alt_up_char_buffer_dev *char_buffer, alt_up_pixel_buffer_dma_dev* pixel_buffer)
{
		//enemy
		alt_up_char_buffer_string(char_buffer, "HP:", 40, 20);
		alt_up_pixel_buffer_dma_draw_box(pixel_buffer, 155, 78, 205, 87, 0x00000000,0);

		alt_up_pixel_buffer_dma_draw_box(pixel_buffer, 172, 81, 172+enemy_hp, 83, 0xe025e025,0);

}
//enemy's attack
void enemy_moves(int healthpoint, int enemy_healthpoint, int enemy)
{
	
	alt_up_char_buffer_clear(char_buffer);
	//first enemy's move
	if(enemy == 1)
	{
			alt_up_char_buffer_string(char_buffer, "Caterpie used Shield Dust!", 0, 0);
			alt_up_char_buffer_string(char_buffer, "It's super effective!", 0, 2);
			alt_up_char_buffer_string(char_buffer, "You lost 3 HP!", 0, 4);
			hp = healthpoint - 3;
			health_bar(hp, char_buffer, pixel_buffer);
			
			if(hp < 1 )
			{
				alt_up_char_buffer_string(char_buffer, "You lost the fight!", 0, 6);
			}
			usleep(3000000);


	}
	//secound enemy's move
	else if(enemy == 2)
	{
				alt_up_char_buffer_string(char_buffer, "Growlithe used Flash Fire!", 0, 0);

					alt_up_char_buffer_string(char_buffer, "It's super effective!", 0, 2);
					alt_up_char_buffer_string(char_buffer, "You lost 7 HP!", 0, 4);
					hp = healthpoint - 7;
					health_bar(hp, char_buffer, pixel_buffer);

					if(hp < 1 )
					{
						alt_up_char_buffer_string(char_buffer, "You lost the fight!", 0, 6);
					}
					usleep(3000000);

	}
	//third enemy's move
	else if(enemy == 3)
	{
				alt_up_char_buffer_string(char_buffer, "Mewtwo used Unnerve!", 0, 0);

					alt_up_char_buffer_string(char_buffer, "It's super effective!", 0, 2);
					alt_up_char_buffer_string(char_buffer, "You lost 20 HP!", 0, 4);
					hp = healthpoint - 15;
					health_bar(hp, char_buffer, pixel_buffer);

					if(hp < 1 )
					{
						alt_up_char_buffer_string(char_buffer, "You lost the fight!", 0, 6);
					}
					
					// Clear the screen and text
					alt_up_pixel_buffer_dma_clear_screen(pixel_buffer, 0);
					alt_up_char_buffer_clear(char_buffer);
					//game over if the player loses the final battle  
					alt_up_char_buffer_string(char_buffer, "GAME OVER!", 40, 30);
	}

}
//read keyboard/de2 input to determine player's move
